            if '[]' in f:
                t = t + 'a'  # array of
            # override for 'id:ID', ':LABEL', etc.
            if f in ['id:ID', ':LABEL', ':START_ID', ':END_ID', ':TYPE']:
                t = 's'
            types.append(t)

        l = []
        for i in range(1, len(lines)):
