**Changes Made**

*   Introduced a `ContainerStrategy` abstract base class to define the interface for container selection strategies.
*   Created a `DefaultContainerStrategy` class that implements the default container selection logic.
*   Modified the `ContainerFinder` class to accept a `strategy` parameter in its constructor, which allows for dynamic selection of container selection strategies.
*   Introduced a `ContainerFinderWithStrategy` class that extends `ContainerFinder` and allows for strategy selection based on a `strategy_name` parameter.
*   Added a `NullContainerStrategy` class that always returns a `NullContainer` instance.

